// Helper: format timestamp to "YYYY-MM-DD HH:mm"
function formatToMinute(ts) {
  const d = new Date(ts);
  const pad = n => n.toString().padStart(2, '0');
  return `${d.getFullYear()}-${pad(d.getMonth() + 1)}-${pad(d.getDate())} ` +
         `${pad(d.getHours())}:${pad(d.getMinutes())}`;
}

// Helper: escape CSV fields (quotes, commas, special chars)
function escapeCsvField(field) {
  if (field == null) return '';
  const s = String(field);
  return `"${s.replace(/"/g, '""')}"`;
}

const data = widgetContext.data;

// Filter only series with data
const nonEmptySeries = data.filter(serie => serie.data && serie.data.length > 0);

if (!nonEmptySeries.length) {
  console.log("no data to export");
  return;
}

// Group values by minute string
const grouped = {};
nonEmptySeries.forEach((serie, sIdx) => {
  serie.data.forEach(point => {
    const minuteKey = formatToMinute(point[0]);
    if (!grouped[minuteKey]) grouped[minuteKey] = {};
    grouped[minuteKey][sIdx] = point[1]; // store value by series index
  });
});

// Sort by time
const sortedKeys = Object.keys(grouped).sort();

// Build CSV header
const header = ['Fecha y Hora'].concat(nonEmptySeries.map(serie => serie.dataKey.label || serie.dataKey.name));

// Build rows
const rows = sortedKeys.map(minuteKey => {
  const row = [minuteKey];
  nonEmptySeries.forEach((serie, sIdx) => {
    row.push(grouped[minuteKey][sIdx] ?? '');
  });
  return row;
});

// Escape fields & combine into CSV
